Calling citizen scientists! RMIT researchers need volunteers from @cityofmelbourne @YarraCouncil and
@cityportphillip to collect micro climate data that will enable communities to plan for extreme heat. Sign up here: https://t.co/WhmmodHzDG @ecocityforum
